import styled from 'styled-components'

const AboutContainer = styled.div`
  min-height: calc(100vh - 60px);
  margin: 0 auto;
  max-width: 1100px;
`

const About = () => {
  return (
    <AboutContainer>Hi, I am Sashank!</AboutContainer>
  )
}

export default About
